        echo "<section id=\"about-us\">
\t<h1 class=\"titulo\">Somos Nerds! puros Nerds toDevelop!</h1>

\t<div class=\"text\">
\t\t<p>Este es el resultado del proyecto de fin de ciclo de tres compañeros de DAW.<br>
\t\t\tAquí intentaremos unificar todos esos recursos, apuntes, ejercicios, enlaces, tips y cosas que estamos hartos de perder el tiempo buscando de forma recursiva y reiterada entre nuestros archivos o el infinito mundo de internet.
\t\t</p>
\t\t<p>
\t\t\tMuchos diréis que podríamos haber usado un Drive, Cloud, Git... pero la realidad es que después de vivir la experiencia de empezar a estudiar en el sector de las TIC, sabemos como puede ser de desmotivador en ciertos momentos buscar documentación por internet.  Y como lo vivimos y sabemos cuanto nos hubiese gustado que nos echasen una mano en esos momentos de ansiedad, aprovechamos para compartir nuestros limitados conocimientos y experiencias con todos esos compañeros que se animan y empiezan a dar sus primeros pasos en este sector, como en su día nos hubiese gustado que otros hicieran con nosotros
\t\t</p>
\t\t<p>
\t\t\tAdictos a la programación, Geeks de las TIC. Aprendimos mucho, y NO queremos para de hacerlo. Por ello, si en nuestros apuntes detectas información incorrecta o imprecisa, no dudes en informarnos, pues sabemos que estamos en un sector en constante evolución y somos conscientes de que hay mucho a mejorar.<br/>
\t\t\tToda contribución a nuestro aprendizaje será más que bienvenida.
\t\t</p>

\t\t<p>
\t\t\tPero cuidado, si eres uno de esos programadores Pro repleto de orgullo y con ganas de criticar, te equivocaste de web. Tomate una píldora de humildad y empieza por preguntarte\t<i>¿Si tan experto eres, que haces buscando ayuda en una web de novatos?</i>. Ahorrate los tecnicismos y los comentarios vanidosos, los minadores de moral no tienen futuro.<br/>
\t\t\tAporta o Aparta!!
\t\t</p>

\t</div>
</section>
